( function( $ ) {
	var $html, $body, $window, adminbarOffset, pageSkroll, ajaxsending, clickTarget, isMenuClicked;

	$( document ).ready( function() {

		$html 		   = $( 'html' )
		$body          = $( document.body );
		$window        = $( window );
		ajaxsending    = false;
		adminbarOffset = $body.is( '.admin-bar' ) ? $( '#wpadminbar' ).height() : 0;

		mobile  = detect.mobile;
		tablet  = detect.tablet;

		if ( mobile ){ $html.addClass('is-mobile') }

		if ( tablet ){ $html.addClass('is-tablet') }

		$(document).ready(function($){
			$('body').addClass('document-ready');
		});

		$(window).bind('beforeunload', function(){
			$('body').removeClass('document-ready');
		});

		window.onpopstate = function(event) {
			if ( ! $('body').hasClass('document-ready') ){
				$('body').addClass('document-ready');
			}

			hb_classes_filter_hash();
		}

		// Menu
		$(document).on('click', '#hb-toggle-menu',function(){

			$('html').toggleClass('menu-popsout');
		});

		$(document).on('click',function(e){

			isMenuClicked = $( e.target );

			if ( $html.hasClass('menu-popsout') && ! isMenuClicked.is('#hb-fancy-menu') && ! isMenuClicked.is('#hb-fancy-menu *') ){
				$html.removeClass('menu-popsout');
			}
		});

		// Popup helpers
		function close_popup(){

			if ( ! $('#hb-popup').length ){ return }

			$body.addClass('removing-popup');

			setTimeout(function(){

			$body.removeClass('popup removing-popup');

				$('#hb-popup').remove();

			}, 300);
		}

		function display_popup( html ){

			if ( ! html ){ return }

			if ( $('#hb-popup').length ){

				$body.removeClass('popup removing-popup');
				$('#hb-popup').remove();
			}

			$('<div id="hb-popup"></div>').appendTo('body');

			$('#hb-popup').html( html );

			setTimeout(function(){

				$body.addClass('popup');

			}, 100);
		}

		// Class page
		$(document).on('click', '.close-popup', function(e){

			e.preventDefault();

			close_popup();
		});

		$(document).on('click', function(e){

			if ( ! $('#hb-popup').length ){ return }

			clickTarget = $( e.target );

			if ( ! clickTarget.is('.popup-inner') && ! clickTarget.is('.popup-inner *') ){
				close_popup();
			}
		});

		$(document).on('keyup', function(e) {

			if (e.keyCode == 27) { // esc

				close_popup();
			}
		});

		$(document).on('click', '.ledolci-class', function(e){

			e.preventDefault();

			if ( ajaxsending ){ return }
			if ( $(this).hasClass('outofstock') ){ return }

			ajaxsending = true;

			$.ajax({

				url         : detect.ajaxurl,
				type        : 'POST',
				dataType    : 'html',

				data        : {
					action            : 'hb_class_popup',
					nonce             : detect.nonce,
					classurl 		  : $(this).attr('href'),
				},

				success     : function( response ) {

					if( $(response).length && response != '404' && response != '0' ){

						display_popup( response );

					} else {

						console.log('@leDolci class popup alert:')
						console.log(response);
					} 

					ajaxsending = false;

				},
				complete    : function() {

					ajaxsending = false;
				},
				error       : function() {

					ajaxsending = false;
				}
			});
		});


		function hb_parallax()
		{
			if ( !mobile && !tablet ){

				if ( undefined != pageSkroll ){
					pageSkroll.destroy();
				}	
				pageSkroll = skrollr.init({
					forceHeight: false,
					easing: {
						vibrate: function(p) {
							return Math.sin(p * 10 * Math.PI);
						}
					}
				});
			}
		}

		function hb_carousel()
		{
			if ( ! $('.owl-carousel').length ){

				return;
			}

			$('.owl-carousel').each(function(){

				$(this).owlCarousel({
				    animateOut: 'fadeOut',
				    animateIn: 'fadeIn',
				    items:1,
				    margin:0,
				    stagePadding:0,
				    smartSpeed:450,
				    mouseDrag:0,
				    autoplay:1,
				    loop:1,
				    autoplayHoverPause:1,
				});
			});
		}

		var time = 500,
			speed = 250;
			
		function hb_animations()
		{

			if ( $('.hb-animate-group').length ){

				function hb_animation(){

					$('.hb-animate-group').each(function(){

						var animate_group = $(this);

	                    animate_group.waypoint(function (direction) {

	                        var anime = animate_group.find('.hb-animate');

	                        if ( $(anime).length ){

		                        $(anime).each(function (i) {

		                            var animatedelement = $(this);
									var animation = animatedelement.data('animation');

									if ( ! animation ) {

										animation = 'fadeIn';
									}

									animation += ' animated';

		                            setTimeout(function () {

		                                animatedelement.addClass(animation);

		                            }, i * speed);
		                        });
		                    }

	                    }, {
	                    	offset: '80%',
	                        triggerOnce: true,
	                        context: window
	                    });
					});
					
				} 

				setTimeout(function(){

					hb_animation();

				}, time );
			}


			if ( $('.hb-animate-solo').length ){

				function hb_animation_solo(){

					$('.hb-animate-solo').each(function(){

						var animate_solo = $(this);

	                    animate_solo.waypoint(function (direction) {

							var animation = animate_solo.data('animation');

							if ( ! animation ) {

								animation = 'fadeIn';
							}

							animation += ' animated';

	                        setTimeout(function () {

	                            animate_solo.addClass(animation);

	                        }, speed);

	                    }, {
	                    	offset: '80%',
	                        triggerOnce: true,
	                        context: window
	                    });
					});
				} 

				setTimeout(function(){

					hb_animation_solo();

				}, time );
			}
		}

		function hb_grid()
		{
			if ( ! $('.hb-grid').length ){
				return;
			}

			$('.hb-grid').each(function(){

				var $container = $(this).packery({
				  itemSelector 			: '.hb-box-wrapp',
				  percentPosition		: true,
				  transitionDuration	: '0.2s',
				});
			});
		}

		// classes filter
		function hb_classes_filter()
		{
			if ( ! $('#class-filter-elements').length || ! $('#hero-wrapper').length || mobile || tablet ){
				return;
			}
			
			$('<div id="class-filter"></div>').appendTo('#ledolci-classes-wrapper');

			$('#class-filter').html( $('#class-filter-elements').html() );

			hb_classes_filter_hash();
		}

		function hb_classes_filter_hash()
		{

			var filter = window.location.hash ? window.location.hash : '#ledolci-classes',
				name   = $('#class-filter [href="'+filter+'"]');

			if ( filter && name.length ){

				hb_classes_filter_action( filter, name.text() );
			}
		}

		function hb_classes_filter_total()
		{
			if ( ! $('#class-filter-total').length ){

				$('<div id="class-filter-total"></div>').appendTo('#ledolci-classes-wrapper');
			}

			$('#class-filter-total').text($('.ledolci-class-display').length);
		}

		function hb_classes_filter_reset()
		{
			$('.ledolci-classes').each(function(){

				$(this)
				.addClass('ledolci-class-display')
				.removeClass('ledolci-class-filtered');
			});

			$('#class-filter .filter-name').text(detect.all);

			hb_classes_filter_total();
		}

		function hb_classes_filter_action( filter, name )
		{
			if ( ! filter || ! name || '#ledolci-classes' == filter ){

				hb_classes_filter_reset();
				return;
			}

			filter = 'product-cat-' + filter.replace('#', '');

			$('.ledolci-classes').each(function(){

				if ( $(this).hasClass(filter) ){

					$(this)
					.addClass('ledolci-class-display')
					.removeClass('ledolci-class-filtered');

				} else {

					$(this)
					.addClass('ledolci-class-filtered')
					.removeClass('ledolci-class-display');
				}
			});

			$('#class-filter .filter-name').text(name);

			hb_classes_filter_total();
		}

		$(document).on('click', '#class-filter a', function(){

			hb_classes_filter_action( $(this).attr('href'), $(this).text() );
		});

		$(document).on('click', function(e){

			if ( $('#class-filter').length ){

				if ( $(e.target).is('#class-filter') || $(e.target).is('#class-filter *:not(a)') ){

					$('#class-filter').addClass('active');

				} else {

					$('#class-filter').removeClass('active');
				}
			}
		});
		// end of classes filter

		function hb_promo(){

			console.log( $.cookie('gotpromo') );
			if ( 'yup' == $.cookie('gotpromo') ) {

				$body.addClass('got-the-promo');
			}
		}

		$(document).on('click', '[for="promo-trigger"]', function(){

			$.cookie('gotpromo', 'yup');
		});

		function hb_plugins()
		{
			hb_promo();

			hb_carousel();

			hb_grid();

			hb_classes_filter();

			hb_parallax();

			hb_animations();

		} hb_plugins();

		$window.load(function(){ $html.addClass('window-loaded') });

	} );

} )( jQuery );